import { Component } from "react";
import Item from "../../components/cart-item/Item";

const tileData = ['test', 'test2'
];

class Home extends Component {

    render() {

        return (
            <div>
                <li>
                    <ul>
                        {
                            tileData.map(data => {
                                <p>{data}</p>
                            })
                        }
                    </ul>
                </li>
            </div>
        );
    }
}

export default Home;
